import {
  ChakraProvider,
  Box,
  Container,
  Heading,
  Text,
  extendTheme
} from '@chakra-ui/react';

function App() {
  return (
    <ChakraProvider theme={extendTheme({
      styles: {
        global: (props) => ({
          body: {
            bg: "mode('white', 'black')(props)",
            color: mode('black', 'white')(props),
          },
        }),
      },
    })}>
      <Heading color="black" fontSize="5xl" textAlign="center" mt={0} minW="100vw" bg = "white">
        Image Compression
      </Heading>
      <Box>
      halo
      </Box>
    </ChakraProvider>
  );
}

export default App;
